import React, {Component} from 'react';
import {Nav, Navbar} from "react-bootstrap";

class Navigation extends Component {
    render() {
        return (
            <>
                <Navbar variant="dark" className={'font-weight-bold'}>
                    <Navbar.Brand href="#home">AkMarv Logo</Navbar.Brand>
                    <Nav className="ml-auto">
                        <Nav.Link href="#beats">Beats</Nav.Link>
                        <Nav.Link href="#soundkits">Sound Kits</Nav.Link>
                        <Nav.Link href="#contact">Contact</Nav.Link>
                        <Nav.Link href="#cart"><span><i className={"fa fa-cart"}></i></span>Cart</Nav.Link>
                    </Nav>
                </Navbar>
            </>
        );
    }
}

export default Navigation;
